import {villaService} from "../../service/villaService";
import {GET_VILLA} from "./type";

export const getVilla = () => {
    return async (dispatch) => {
        try{
            const res = villaService.findAll();
            dispatch({
                type: GET_VILLA,
                payload: (await res).data
            })
        }catch (err){
            console.log(err)
        }
    }
}
